using ll = long long;
const string ALPHA = " !#$%&'()*+,-./0123456789:;<=>@ABCDEFGHIJKLMNOPQRSTUVWXYZ[]^_`abcdefghijklmnopqrstuvwxyz{|}~";
const ll MUL = 350000, MOD = (1LL << 32) - 5;
int cmap[256];
map<ll, unsigned int> imap;

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(NULL);

    // convert from encoded
    for (auto i = 0; i < (int)ALPHA.length(); i++)
        cmap[(int)ALPHA[i]] = i;
    imap[0] = 1;
    int ns = ST.length() / 5;
    for (auto i = 0; i < ns; i++) {
        ll num = 0;
        for (auto j = i*5; j < (i+1)*5; j++)
            num = ALPHA.length() * num + cmap[(int)ST[j]];
        imap[MUL * (i+1)] = num;
    }

    // solve
    int T; cin >> T;
    while (T--) {
        unsigned long long N; cin >> N;
        if (N >= MOD) cout << (0) << '\n';
        else {
            auto ptr = --imap.upper_bound(N);
            unsigned long long ans = ptr->second;
            for (ll cur = ptr->first+1; cur <= N; cur++)
                ans = (ans * cur) % MOD;
            cout << (ans) << '\n';
        }
    }

    return 0;
}